import styled from 'styled-components';
import crownLogo from '../../assets/crown.png';

export const AdminDashboardPageWrapper = styled.div`
    width: 78.78vw;
    height: 81.25vh;
    background-image: url(${crLogo});
    display: flex;
    background-color: #ededed;
    align-items: center;
    justify-content: space-between;
    margin: 20px auto;
`;
